NodeJS/Mongo Retrieve relational data on collection lookup<p>I have a very simple calendar/booking system that I'm building. A <code>calendar</code> entry refers to a given date, with a <code>maxAppointments</code> value. Anytime a booking is made, an entry is added to the <code>bookings</code> table with the given number of appointments (a <code>calendar</code> entry can have many <code>booking</code> entries).</p>

<p>// calendarModel.js</p>

<pre><code>import mongoose from 'mongoose';
const { Schema } = mongoose;

var CalendarSchema = new Schema({
  startDate: {
    type: Date,
    default: Date.now
  },
  maxAppointments: {
    type: Number,
    required: 'Max Appointments Required'
  },
})

module.exports = mongoose.model('Calendar', CalendarSchema)
</code></pre>

<p>// calendarController.js</p>

<pre><code>import mongoose from 'mongoose' 
import moment from 'moment'
const Calendar = mongoose.model('Calendar')

// FIXME: listCalendar needs to return the number of currently available slots
export const listCalendar = (req, res) =&gt; {
  let now = moment().toDate()
  Calendar.find({startDate : { $gte : now }}, (err, calendar) =&gt; { 
    if (err)
      res.send(err)
    res.json(calendar)
  })
}
</code></pre>

<p>// bookingModel.js</p>

<pre><code>import mongoose from 'mongoose';
const { Schema } = mongoose;

var BookingSchema = new Schema({
  calendarId: {
    type: String,
    required: 'Calendar ID Required'
  },
  appointments: {
    type: Number
  },
});

module.exports = mongoose.model('Bookings', BookingSchema)
</code></pre>

<p>Once payment is complete, an entry is added to the <code>booking</code> collection with the <code>calendarId</code> and the number of appointments that this booking has. The question that I have is how to adjust listCalendar to return the number of <code>availableAppointments</code> (which is <code>calendar.maxpAppointments</code> - <code>the sum of all appointments where booking.calendarId==selectedCalendarId</code>)</p>

<p>I currently see two options:</p>

<ol>
<li>Anytime a <code>calendar</code> entry is retrieved, also retrieve the sum of <code>booking.appointments</code> (this would be calculated on the fly).</li>
<li>Add a field titled <code>bookedAppointments</code> to <code>calendarModel</code> and add/subtract to this field anytime a booking is made. </li>
</ol>

<p>What's the best way to handle this, and there is the best place to put this logic? If I take route #1, should I add this logic to <code>listCalendar</code>?</p>

