Spring Reactive Web update method makes a new record instead of update the existing one<p>Currently I'm using Spring Webflux and MongoDB, along with a set of CRUD REST API.
So I have a service method that takes in an ID of an existing object, an updated object, then mapping the updated one's data into the existing one. Like here:</p>

<p>ServiceImpl.java</p>

<pre><code>@Override
public Mono&lt;Computer&gt; update(String id, Computer computer) {
    return repo.findById(id)
            .switchIfEmpty(Mono.error(new Exception("COMPUTER_NOT_FOUND")))
            .map(c -&gt; computer)
            .flatMap(repo::save);
}
</code></pre>

<p>My REST Controller method:
EnpointController.java</p>

<pre><code>@PutMapping("/{id}")
public Mono&lt;Computer&gt; updateOneComputer(@PathVariable("id") String id,@Valid @RequestBody Computer parsedBody) {
    return computerService.update(id, parsedBody);
}
</code></pre>

<p>But the problem is: Instead of update, it makes a new record into db. I have try something like set individual field of the existed object with the update one. It works, updated the existing document, but not efficient. It's not a solution, especially with the embedded document in Mongo.
Like this: </p>

<pre><code>@Override
public Mono&lt;Computer&gt; update(String id, Computer computer) {
    return repo.findById(id)
            .switchIfEmpty(Mono.error(new Exception("COMPUTER_NOT_FOUND")))
            .map(c -&gt; {
                c.setFoo(computer.getFoo());
                c.setBar(computer.getBar());
                //and so on!
            })
            .flatMap(repo::save);
}
</code></pre>

<p>My entities</p>

<p>Computer.java</p>

<pre><code>@Document(value = "computers")
@Data
@EqualsAndHashCode(callSuper = true)
@NoArgsConstructor
@AllArgsConstructor
public class Computer extends BaseDocument {

    private String name;
    private String customerId;
    private String computerModel;
    private String computerSpecs;
    private String otherPart;
}
</code></pre>

<p>BaseDocument.java</p>

<pre><code>@Data
@NoArgsConstructor
@AllArgsConstructor
public class BaseDocument {

    @Id
    private String id;
    @CreatedDate
    private Date createdDate;
    @LastModifiedDate
    private Date updatedDate;
    @CreatedBy
    private String createdBy;
    @LastModifiedBy
    private String updatedBy;
    private char deleted = 'N';
}
</code></pre>

<p>Please help and thanks in advance!</p>

