Query performance of a range query with date field<p>I am looking for performance optimization of a query. My goal is to find all documents falling in given date range. The collection is quite big, it has over 6 million documents. So the query is as follows:</p>

<pre><code>db.collection.find({
    createdAt: {
        $gte: new Date('2018-06-19'), 
        $lt: new Date('2018-06-22')
    }
})
</code></pre>

<p>It runs for over 10 mins. Is there a way to utilize the fact that the dates are sorted? I mean the documents are inserted at creation time so every document past last document falling into the range will be out of range, but mongo probably doesnt know that and seeks for those documents where dates are already out of range ??</p>

